import React, { Component } from "react";

class Footer extends Component {
  state = {};
  render() {
    return (
      <div
        // style={{
        //   paddingTop: 50,
        //   padding: 50,
        //   paddingBottom: 10,
        // }}
        className="jumbotron jumbotron-fluid"
        className="text-right pb-1"
      >
        <div className="container">
          <h5 className="display-4" className="text-left text-dark  mt-1">
            Owner's message
          </h5>
          <p className="lead medium" className="text-left text-dark pr-5 mt-1">
            Need a talented individual to cover an <br />
            occasion? Browse through our list of curated <br />
            photographers or let us find one for you
          </p>
        </div>
      </div>
    );
  }
}

export default Footer;
